import React from "react";

const Box = (DataMenu) => {

    return (
        <div>
            {
                DataMenu.length >= 1 ? (DataMenu.map((item) => {
                    return (
                        <div className="card" >
                            <img className="image-menu" src="image-1.jpg" />
                            <div className="text" >
                                <h5>Eggs with Meat</h5>
                                <p>Fried eggs with meat cubes</p>
                                <b>17$</b>
                            </div>
                        </div>
                    )
                })) : null
            }
        </div>
    )
}

export default Box
